import { List } from "@material-ui/core";
import PortfolioList from "../portfolioList/PortfolioList";
import "./portfolio.scss";

export default function Portfolio() {

    const list = [
        {
            id: 'featured',
            title: 'featured'
        },
        {
            id: 'web',
            title: 'web app'
        },
        {
            id: 'mobile',
            title: 'mobile app'
        },
        {
            id: 'design',
            title: 'design'
        },
        {
            id: 'content',
            title: 'content'
        },
    ]

    return (
        <div className='portfolio' id='portfolio'>
            <h1>Portfolio</h1>
            <ul>
               {list.map(item=>(
                   <PortfolioList title={item.title} />
               ))}
            </ul>
            <div className="container">
                <div className="item">
                    <img src="assets/img.jpg" alt="" />
                    <h3>Banking App</h3>
                </div>
                <div className="item">
                    <img src="assets/img.jpg" alt="" />
                    <h3>Banking App</h3>
                </div>
                <div className="item">
                    <img src="assets/img.jpg" alt="" />
                    <h3>Banking App</h3>
                </div>
                <div className="item">
                    <img src="assets/img.jpg" alt="" />
                    <h3>Banking App</h3>
                </div>
                <div className="item">
                    <img src="assets/img.jpg" alt="" />
                    <h3>Banking App</h3>
                </div>
                <div className="item">
                    <img src="assets/img.jpg" alt="" />
                    <h3>Banking App</h3>
                </div>
            </div>
        </div>
    )
}
